/**
 * Interface for variable objects.
 * @export
 * @interface IVariable
 */
export interface IVariable {
    /**
     * Name of the variable.
     * @type {string}
     * @memberof IVariable
     */
    name: string;
    /**
     * Value of the variable.
     * @type {string}
     * @memberof IVariable
     */
    value: string;
}
